import React from 'react';

const Date = ({petDate}) => (
    <div className="pet-date">
        <p>Mascota: <span>{petDate.mascota}</span></p>
        <p>Mascota: <span>{petDate.petOwner}</span></p>
        <p>Mascota: <span>{petDate.hour}</span></p>
        <p>Mascota: <span>{petDate.date}</span></p>
        <p>Mascota: <span>{petDate.symptoms}</span></p>
    </div>
)

export default Date;
